    "inputText": "Permian Gastroenterology Associates LLP\n315 E 5th Street, Odessa, TX 79761\nRavikumar P. Vemuru, M.D.\nSyam Vemulapalli, M.D.\nBoard certified in Gastroenterology and Internal medicine.\nPATIENT NAME:  XXX\t\t\t\t\t\t        MRNO:\nDATE OF BIRTH:  XXX\nDATE OF VISIT:  XXX\nREFERRING PHYSICIAN:  Dr. Richard Bartlett.\nCHIEF COMPLAINT:  Abdominal pain.\nHISTORY OF PRESENT ILLNESS:  The patient is a 79-year-old male who has been complaining of worsening constipation as well as left sided abdominal pain for more than one month duration.  He also has a history of back pain and has been taking Lortab.  The patient denies any nausea or vomiting, but complains of decreased appetite.  No history of any melena or hematochezia.  The patient states that he did not have any bowel movements in the last two weeks.  The patient appears to be a very poor historian.  Also, according to the family members his symptoms started after his wife died within the last one year.  The patient had a colonoscopy more than four years ago by Dr. Tamar at which time a few polyps were removed.\nPAST MEDICAL HISTORY:\nHistory of diverticulitis.\nHistory of shingles.\nGrave’s disease.\nHistory of colon polyps.\nSOCIAL HISTORY:  The patient denies any alcohol or smoking.\nFAMILY HISTORY:  Negative for any GI malignancies.\nCURRENT MEDICATIONS:  Include:\nLortab.\nMetoprolol.\nNeurontin.\nMEDICATION ALLERGIES:  NKDA.\nREVIEW OF SYSTEMS:\nGENERAL:  Positive for weakness.  Denies any fatigue or fever.\nSKIN:  No rashes or skin lesions.\nHEENT:  Positive for hearing loss.  Head:  Negative for history of head injury, headache, or dizziness.\nEYES:  No recent change in vision.  Denies blurring of vision or diplopia.\n?\nXXX\t\t\t\t\t\t\t\t\t\t   PAGE TWO\nXXX\nEARS:  Negative for tinnitus, vertigo, or earaches.\nNOSE:  Negative for hay fever, nasal discharge, and nasal stuffiness.\nTHROAT:  Negative for sore throat or hoarseness.\nNECK:  No swollen glands, lumps, pain, or stiffness.\nRESPIRATORY:  Negative for cough, sputum production, hemoptysis, or shortness of breath.\nCARDIOVASCULAR:  No dyspnea, orthopnea, chest pain, or palpitations.\nGASTROINTESTINAL:  Appetite is good.  Negative for dysphagia, odynophagia, nausea, vomiting, indigestion, diarrhea, or constipation.  No abdominal pain.  Bowel movements are regular.  No hematochezia or melena.\nGENITOURINARY:  No frequency, dysuria, hematuria, or urinary incontinence.\nPERIPHERAL VASCULAR:  No history of phlebitis or leg pain.  Negative for intermittent claudication.\nMUSCULOSKELETAL:  Denies arthralgia, injury, or swelling.  Denies any muscle stiffness, arthritis, gout, backache, or limitation of motion or activity.\nNEUROLOGICAL:  No fainting, seizures, motor, or sensory loss.  Long-term and short-term memory is intact.  Denies frequent headaches, weakness of the extremities, or slurring of the speech.\nPSYCHIATRIC:  No history of depression or treatment for psychiatric disorders.\nPHYSICAL EXAMINATION:\nVital signs:  Blood pressure:  163/87 mmHg.  Pulse:  70.  Temperature:  96.2.\nGeneral:  The patient is in no acute distress.  Alert, awake, and comfortable.\nHEENT:  Head:  Normocephalic and atraumatic.  Hair of average textures.  Scalp without lesions.\nSkin:  No infections, jaundice, rash, or petechiae.\nEyes:  Conjunctiva moist and pink.  PERRLA.\nEars:  Auditory, acuity good to whispered voice.\nNose:  Mucosa is pink.  No sinus tenderness.  No nasal discharge.\nMouth:  Oral mucosa is moist and pink.  No gingivitis.\nNeck:  Supple.  Trachea is midline.  No thyromegaly.  No lymphadenopathy.  Carotid, no bruits.\nHeart:  S1 and S2 regular.  No S3 or S4.  No murmurs.  No jugular vein distention.\nThorax:  Symmetric with good excursion.\nLungs:  Clear.  No rales, wheezing, or rhonchi.\nAbdomen:  Positive for mild left lower quadrant tenderness without any guarding or rigidity.  Soft and non-distended.  No masses.  No costovertebral angle tenderness.  Bowel sounds are active.\nPeripheral vascular:  Negative for ankle edema.  No stasis, pigmentation, or ulcers.  Radial pulses are 2+.  Dorsalis pedis 2+.\nMusculoskeletal:  No joint deformities.  Good range of motion.\nASSESSMENT:\nLeft lower quadrant abdominal pain.  Recurrent diverticulitis needs to be ruled out.\nConstipation.\nRecent weight loss.\nHistory of colon polyps.\n?\nXXX\t\t\t\t\t\t\t\t\t          PAGE THREE\nXXX\nPLAN:\nWe will obtain a CT scan of the abdomen and pelvis.\nThe patient was started on MiraLax 17 g p.o. q.h.s.\nIf CT scan is unremarkable, then we will proceed with a surveillance colonoscopy.  The procedure, risks, benefits, and alternatives were discussed with the patient.  The patient is agreeable for the procedure.\nThank you Dr. Bartlett for allowing us to participate in the care of this patient.\n______________________\nSyam Vemulapalli, M.D.\nRje/hma\ncc:\tDr. Richard Bartlett\nPhone: 432 333 3433\t\t\t\tFax: 432 333 3450\t\t\t\tEmail : Raviv @ aol.com\n",
